INSERT INTO `flyin_aboutus` (`id`, `profile`, `culture`, `certification`, `status`) VALUES
(1, '飛宇集團始创于2005，是一家专业从事研发、生产和销售光纤通信器件和设备的高新科技企业。拥有6000多平厂房及300多名员工。\r\n业务范围：公司产品覆盖光通信行业无源和有源两大块，产品质量和市场占有率均在行业里名列前茅。无源器件产品主要有：波分复用器\r\n（CWDM、DWDM、FWDM、OADM、AWG）、光分路器、光纤跳线、光开关、环行器、光隔离器等及其相关的大功率和保偏器件。有源设备类的产品有：光模块、波分复用系统、线路/旁路保护设备、EDFA、收发器等。\r\n发展方向：飛宇集團的理念是＂以技术引领发展，以服务赢得市场，以质量树立品牌＂，明确公司的发展目标和方向，先后通过了ISO9001：2008质量管理体系认证和ISO14001环境管理体系认证。\r\n飞宇集团一直倡导“双赢共生”的企业文化和合作观念来建设和引导公司的发展，同时积极以“品牌化战略”来推广公司及产品，目前已经与70多个国家和地区的400多家运营商、系统集成商和通信设备制造商建立了长期稳定的合作伙伴关系。', '深圳市飞宇集团有源部期待与您的合作.', '59b8aa2136f21.png', 1);
