INSERT INTO `flyin_goods` (`goods_id`, `goods_name`, `goods_title`, `goods_price`, `goods_stock`, `cat_id`, `goods_sku`, `is_show`, `list_time`, `list_date`, `goods_pdf`, `goods_desc`, `goods_performance`, `img_center`, `parameter_name`, `parameter_value`, `hits`, `pdfhits`, `hot`) VALUES
(3, '工业级千兆3光6电交换机', 'FLY-IMC系列百兆高级管理型冗余以太网交换机配有3个千兆光口，方便构建千兆冗余环网。支持“FLY Ring”冗余环网（自愈时间&lt;20ms）、RSTP、STP以及MSTP协议，增强了网络系统的可靠性和实用性。FLY-IMC系列可应用于能源、交通以及工业自动化等各工业领域。', 'FLY-IMC-3F6GT', 0, 1, '', 1, '2017-09-19 17:53:28', 1505750400, NULL, '<p style="padding:0px;margin-top:0px;margin-bottom:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);"><span style="padding:0px;margin:0px;color:rgb(102,102,102);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">2个千兆光口用于环网冗余，1个千兆光口连接上行光口。</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(102,102,102);">支持飞宇环协议FIY Ring（自愈时间&lt;20ms）和RSTP/STP/MSTP以太网冗余</span><br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(102,102,102);">支持SNMPv3、 IEEE 802.1X、 HTTPS以及SSH，增强了网络安全性</span><br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(102,102,102);">支持WEB、CLI、Telnet /serial console 、Windows utility和SNMP多种管理方式</span><br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(102,102,102);">采用工业级设计：-40至75°C工作温度和冗余电源输入</span><br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(102,102,102);">防护等级：IP40</span></span></p><p><br /></p>', '<ul style="list-style-type:none;" class="list-paddingleft-2"><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持命令行界面（CLI），方便快速配置主要管理功能</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持IEEE 1588 PTP V2（精密时间协议），实现精确的网络时间同步</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">DHCP Option 82用于以不同策略分配IP地址</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持飞宇环协议"FLY Ring"（自愈时间&lt;20ms）、STP、RSTP以及MSTP以太网冗余</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持基于端口的VLAN，IEEE 802.1Q VLAN和GVRP协议，简易网络规划</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持Ethernet/IP 和 Modbus/TCP协议用于设备管理和控制</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">IGMP Snooping和GMRP过滤多播流量</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持端口镜像</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持多播、广播风暴控制</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持QoS和ToS/DiffServ，用于流量控制和管理</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持链路聚合，优化带宽利用率</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持SNMPv3、 IEEE 802.1X、 HTTPS和SSH，加强网络安全性</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持TACACS+</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持SNMPv1/v2c/v3 不同安全级别的网络管理</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">采用RMON有效提升网络监测和预测能力</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持带宽管理，确保网络稳定性</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持基于MAC地址的端口锁定，防止非法入侵</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">通过E-mail和继电器输出，实现自动报警</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持DDM（Digital Diagnostic Monitoring</span></p></li></ul><p><span style="padding:0px;margin:0px;font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"></span></p><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">优先级队列：4</span></p><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">可用VLAN 的最大数量：256</span></p><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">VLAN ID范围：VID1 ~ 4094</span></p><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">IGMP组：256</span></p><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">MAC地址表大小：8K</span></p><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">封包缓冲区大小：1 Mbit</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;">电源要求：</strong></span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;">机械特性：</strong></span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;">工作温度：</strong></span></p><ul style="list-style-type:circle;" class="list-paddingleft-2"><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">标准型：0 ~ +60°C (32 ~ 140°F )</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">宽温型：-40 ~ +75°C (-40 ~ 167°F )</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">储存温度：-40 ~ +85°C（-40 ~ 185°F ）</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px