%（无凝露）</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">外壳：金属，IP40防护等级</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">尺寸：60.2 x 115.5 x 138.5 mm</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">重量：750g</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">安装方式：导轨安装、壁挂式安装</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">FLY-IMC-2F6T：&lt;0.51A@24VDC</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">输入电压：24VDC（18 ~ 36VDC），冗余双电源输入</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">输入电流：</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">过电流保护：提供</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">反接保护：提供</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">连接器：6针接线端子</span></p></li></ul><p><br /></p>', '59c0e9b94b8f6.png', NULL, NULL, 15, 0, 'no'),
(7, '千兆24口全光交换机', 'FLY-IMCS系列智能型光纤以太网交换机，下联光口可以用户根据网络配置的需要，灵活选择百兆或者千兆SFP光模块进行组网。', 'FLY-IMCS-26F2GT', 0, 1, '', 1, '2017-09-19 17:59:27', 1505750400, NULL, '<p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);">丰富的QoS策略</strong><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;background-color:rgb(255,255,255);color:rgb(102,102,102);"></span><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';color:rgb(65,65,62);background-color:rgb(255,255,255);"></span></span></p><ul style="list-style-type:none;" class="list-paddingleft-2"><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持双向端口限速。并且支持镜像功能，当镜像功能被启用时，镜像端口的数据将被复制到监控端口，以备网络测试和故障诊断。用户可配置端口镜像，支持一个或多个端口上的入流量/出流量/双向数据流监控。</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持队列调度算法：严格优先级（SP）和加权轮询算法（WRR）</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持不同的优先级标准：基于端口优先级、DSCP优先级和802.1p优先级。</span></p></li></ul><p style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(102,102,102);"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;">高可靠性</strong></span></p><ul style="list-style-type:none;" class="list-paddingleft-2"><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">FLY-IMCS系列交换机支持STP / RSTP / MSTP。该特性通过冗余备份和容错能力大大提高了网络的稳定性。</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">FLY-IMCS系列交换机支持链路聚合。该协议是扩展交换机端口带宽和平衡链路聚合中各端口流量的简单经济的方法，并且能增强连接可靠性。</span></p></li></ul><p style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(102,102,102);"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;">管理&amp;维护</strong></span></p><ul style="list-style-type:none;" class="list-paddingleft-2"><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">FLY-IMCS系列交换机支持web网页管理和固件在线升级。</span></p></li></ul><p><br /></p>', '<ul style="list-style-type:none;" class="list-paddingleft-2"><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">无阻塞储存转发交换模式：背板带宽52Gbps</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">支持8K MAC地址表、支持MAC地址黑洞、支持MAC地址学习数量限制</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">支持基于端口的VLAN、支持802.1Q VLAN (4K VLAN)、支持基于协议VLAN</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">支持静态链路聚合、支持多达14个聚合组以及每组多达8个端口</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">支持全双工IEEE 802.3x流量控制，半双工背压式流量控制</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">支持广播风暴抑制</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">支持 STP/RSTP</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">支持镜像：可镜像各端口入流量/出流量/双向流量、可单独配置端口入流量/出流量镜像</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">安全特性：支持不同级别的管理和密码保护、支持端口隔离</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">QoS：各端口支持4个出队列、支持基于端口优先级、802.1p优先级和DSCP优先级</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">支持SP/WRR队列调度算法、支持端口双向速率限制</span></p></li><li><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">管理与维护：支持通过Web浏览器从本地/远端进行网络