nt-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">&lt; 45w</span></td></tr><tr style="padding:0px;margin:0px;"><td style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><strong style="padding:0px;margin:0px;">MTBF</strong></span></td><td colspan="4" style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">65,000 hrs (25°C)</span></td></tr><tr style="padding:0px;margin:0px;"><td style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><strong style="padding:0px;margin:0px;">工作温度</strong></span></td><td colspan="4" style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">0°C ～60°C</span></td></tr><tr style="padding:0px;margin:0px;"><td style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><strong style="padding:0px;margin:0px;">存储温度</strong></span></td><td colspan="4" style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">-10°C ～70°C</span></td></tr><tr style="padding:0px;margin:0px;"><td style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><strong style="padding:0px;margin:0px;">相对湿度</strong></span></td><td colspan="4" style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">5% t～ 90% (non-condensing)</span></td></tr></tbody></table></li></ul><p><br /></p>', '59c0ea7fa4b17.png', NULL, NULL, 9, 0, 'no');
