x;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持SNMPv3、 IEEE 802.1X、 HTTPS和SSH，加强网络安全性</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持TACACS+</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持SNMPv1/v2c/v3 不同安全级别的网络管理</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">采用RMON有效提升网络监测和预测能力</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持带宽管理，确保网络稳定性</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持基于MAC地址的端口锁定，防止非法入侵</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">通过E-mail和继电器输出，实现自动报警</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持DDM（Digital Diagnostic Monitoring</span></p></li></ul><p><span style="padding:0px;margin:0px;font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"></span></p><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">优先级队列：4</span></p><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">可用VLAN 的最大数量：256</span></p><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">VLAN ID范围：VID1 ~ 4094</span></p><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">IGMP组：256</span></p><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">MAC地址表大小：8K</span></p><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">封包缓冲区大小：1 Mbit</span></p><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">支持POE at协议</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(0,0,0);">电源要求：</span></strong></span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(0,0,0);">机械特性：</span></strong></span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><strong style="padding:0px;margin:0px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(0,0,0);">工作温度：</span></strong></span></p><ul style="list-style-type:circle;" class="list-paddingleft-2"><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">标准型：0 ~ +60°C (32 ~ 140°F )</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">宽温型：-40 ~ +75°C (-40 ~ 167°F )</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">储存温度：-40 ~ +85°C（-40 ~ 185°F ）</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">相对湿度： 5 ~ 95%（无凝露）</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">外壳：金属，IP40防护等级</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">尺寸：60.2 x 115.5 x 138.5 mm</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">重量：750g</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">安装方式：导轨安装、壁挂式安装</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(0,0,0);font-size:14px;">FLY-IMC-2F6T：&lt;0.51A@24VDC（非POE状态）</span></p></li><li><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;color:rgb(0,0,0);font-size:14px;">输入电压：48VDC冗余双电源输入</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">输入电流：</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">过电流保护：提供</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">反接保护：提供</span></p></li><li><p><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">连接器：6针接线端子</span></p></li></ul><p><br /></p>', '59c0ec2d70a88.png', NULL, NULL, 7, 0, 'no'),
