(25, '外置百兆一光一电收发器', '', 'FLY-1F1T-SWDX', 0, 4, '', 1, '2017-09-19 18:36:43', 1505750400, NULL, '<p><span style="color:rgb(65,65,62);background-color:rgb(255,255,255);font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">外置电源光纤收发器是完成10/100Base-TX 到100Base-FX 之间的光电转换。该收发器同时支持 IEEE802.3 10Base-T、IEEE802.3u 100Base-TX、100Base-FX 标准，能够有效的支持全双工或半双工模式，是校园和骨干网或交换共享以太网布线环境中的理想设备。可用于连接服务器、工作站,HUB、交换机；该收发器有单模和多模两种光纤传输模式，有多种传输距离 (最远可达120KM) 可供选择 的光纤接口和RJ-45接口。</span></p>', '<p style="padding:0px;margin-top:0px;margin-bottom:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);"><span style="padding:0px;margin:0px;line-height:1.5;font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">◆ 支持IEEE802.3u.100BASE-T和100 BASE-FL协议</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">◆ 支持全双工/半双工工作方式,并带有自动协商功能<br style="padding:0px;margin:0px;" />◆ 多模连接传输距离：2公里<br style="padding:0px;margin:0px;" />◆ 单模连接传输距离：20/40/60/80/120公里<br style="padding:0px;margin:0px;" />◆ 整机发热少，性能稳定可靠<br style="padding:0px;margin:0px;" />◆ 即插即用，可上机架(2U-14槽）<br style="padding:0px;margin:0px;" />◆ 完备的LED状态指示，便于网络诊断和故障检查<br style="padding:0px;margin:0px;" />◆ 自动识别MD1/MD1-X交叉线和平行线<br style="padding:0px;margin:0px;" />◆ 良好的流量控制，带自复位功能，能有效防止死机现象出现<br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;line-height:1.5;">标准协议  LEEE802.3Fast Ethernet 100Base-T和100Base-FL标准</span></span></p><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><span style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);">连 接 器 一个UTP RJ-45连接器，一个FC/SC/ST连接器</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);">指 示 灯 PWR、FDX、FX LINK、TX LINK、TX LINK、TX ACT</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);">工作方式 全双工/半双工，具有全双工/半双工自动协商功能</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);">传输速率 10M/100Mbps</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);">电源参数 OUTPUT:5V  DC  1A</span><span style="color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);"></span></span></p><p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;">工作环境温度 -10℃～55℃ </span><br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;">相对温度 5%～90%</span><br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;">TP线缆 Cat.UTPcable</span><br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;">传输光纤 多模:50/125,62.5,125or100/140um 单模:8.3/125,8.7/125,9/125or10/125um</span><br style="padding:0px;margin:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;">外观尺寸:  94mm x 70mm x 25mm(长x宽x高) </span></span></p><p><br /></p>', '59c0f33b46556.png', '型号', 'ＦＬＹ-1Ｆ1Ｔ-ＳＷＳＸ（单纤）,ＦＬＹ-1Ｆ1Ｔ-ＳＷＤＸ（双纤）,ＦＬＹ-1Ｆ1Ｔ-ＳＷ S F P（SFP接口）', 31, 0, 'no'),
(26, '外置百兆一光二电光纤交换机', '', 'FLY-1F2T-SWDX', 0, 4, '', 1, '2017-09-19 18:38:18', 1505750400, NULL, '<p><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;"><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;text-align:justify;text-indent:-28px;background-color:rgb(255,255,255);">FLY-1F2T-SWSX</span><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;margin:0px;text-align:justify;text-indent:-28px;background-color:rgb(255,255,255);">是一款2个10/100M以太网电口转换为1个100M以太网光口的可远端管理的光纤收发器。它将网络的传输距离从100米的铜线极限扩展到120Km,通过使用数据链路二层存储转发模式来实现光电两种网络连接介质之间的数据传输。支持双纤多模、双纤单模和单纤单模光纤传输。</span></span></p>', '<p style="padding:0px;margin-top:0px;margin-bottom:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);"><span style="padding:0px;margin:0px;line-height:2;font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">²  自动适应10Mbps和100Mbps环境，便于网络的升级<br style="padding:0px;margin:0px;" />²  内置高效交换核心，实现流量控制，减少广播包<br style="padding:0px;margin:0px;" />²  支持协议：IEEE 802.3 10Base-T, IEEE 802.3u 100Base-TX , IEEE 802.3u 100Base-FX, IEEE 802.3x flow control, IEEE 802.1Q VLAN<br style="padding:0px;margin:0px;" />²  支持2个10/100M网口和一个100M光口<br style="padding:0px;margin:0px;" />²  网口自适应直通线和交叉线，能兼容各种网卡，交换机，HUB等以太网设备<br style="padding:0px;margin:0px;" />²  采用存储转发机制来避免网络的丢包和错误帧<br style="padding:0px;margin:0px;" />²  支持最大1552Byte的超长帧<br style="padding:0px;margin:0px;" />²  支持线速转发和全双工流量控制/半双工背压模式<br style="padding:0px;margin:0px;" />²  支持基于端口的VLAN和Tag VLAN</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);"><span style="padding:0px;margin:0px;line-height:2;font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">²  支持死机自动重启<br style="padding:0px;margin:0px;" />²  支持远端掉电功能<br style="padding:0px;margin:0px;" />²  支持双纤多模、双纤单模和单纤单模多种光纤口选择，扩展了用户的需求<br style="padding:0px;margin:0px;" />²  支持SFP模块和DDM数字诊断功能<br style="padding:0px;margin:0px;" />外观尺寸:  94mm x 70mm x 25mm(长x宽x高)</span></p><p><br /></p>', '59c0f39b035ea.png', NULL, NULL, 17, 0, 'no'),
(27, '百兆一光四电光纤交换机', '', 'FLY-1F4T-SWDX', 0, 4, '', 1, '2017-09-19 18:39:59', 1505750400, NULL, '<p><span style="background-color:rgb(255,255,255);font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">产品有4个10/100M自适应RJ45接口和1个100M标准光口，它完全符合IEEE802.3, IEEE802.3u,10BaseT,100BaseTX, 100Base-FX标准。用户可根据需要选用不同的光模块接口，例如100Base-T、100Base-SX、100Base-LX、FC、SC、ST等。交换机采用美国最新IC，性能稳定，质量优良，使用简单方便、具有较高的性价比。特别适用于小型光纤以太网建设及简单IP摄像头监控组网中。</span></p>', '<p style="padding:0px;margin-top:0px;margin-bottom:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);"><span style="padding:0px;margin:0px;color:rgb(0,0,0);font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">◆ 符合IEEE802.3 10 Base-T、IEEE 802.3u 100Base-TX、IEEE802.3z等标准；</span></p><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span style="padding:0px;margin:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);">◆ 4个10/100MRJ45接口，1个SC/FC/ST/100M光接口；</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="padding:0px;margin:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);">◆ 支持全双工和半双工模式；</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="padding:0px;margin:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;background-color:rgb(255,255,255);">◆ 电源：110-265V AC；</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="padding:0px;margin:0px;font-family:Arial, Verdana, Helvetica, san