(31, '千兆一光一电光纤收发器', '外置千兆收发器　', 'FLY-1F1T-SWDXG', 0, 5, '', 1, '2017-09-19 18:48:53', 1505750400, NULL, '<p><span style="padding:0px;margin:0px;color:rgb(51,51,51);background-color:rgb(248,248,248);font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">FLY-1F1T-SWDXG是一款采用1*9光纤模块，支持热插拔，可选配不同性能</span><a href="http://www.utepo.com/products-list.asp?cid=107" style="padding:0px;margin:0px;color:rgb(0,0,0);text-decoration:underline;white-space:normal;background-color:rgb(255,255,255);font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">光模块</span></a><span style="padding:0px;margin:0px;font-size:12px;color:rgb(51,51,51);background-color:rgb(248,248,248);font-family:''微软雅黑'', ''Microsoft YaHei'';">的光纤收发器，该光纤收发器预留了一个1*9或者SFP光口，另外具有一个10M/100M/1000M 自适应的RJ45网络接口，该接口支持全/半双工自动适应和自动MDI/MDIX。 该设备主要用于实现网络电缆和光纤两种不同传输介质的转换，满足远距离、高速、高宽带的快速以太网工作组用户的需要，达到超长距离无中继计算机数据网的高速远程互连。产品光纤接口可实现20KM、40KM、60KM等不同传输距离的传输需要，可与其它具备相同规格的光纤接口产品配套使用，方便传输网络信号。产品可广泛应用于安防监控、会议系统、智能建筑工程等各种数据通讯领域。</span></p>', '<p><span style="padding:0px;font-family:''宋体'';"></span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="padding:0px;background:rgb(248,248,248);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">◆ 适合标准：IEEE802.3z/AB，10/100/1000Base-T和1000Base-SX/LX</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="padding:0px;background:rgb(248,248,248);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">◆ MAC地址表：1K</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="padding:0px;background:rgb(248,248,248);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">◆ 缓存：1M</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="padding:0px;background:rgb(248,248,248);font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;">◆ 背板带宽：可实现无阻塞线速转发</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span styl