(39, '2U 14槽收发器机架', '2U 14槽收发器机架', 'FLY-RACK-14', 0, 6, '', 1, '2017-09-19 19:10:15', 1505750400, NULL, '<p><span style="padding:0px;margin:0px;font-size:12px;background-color:rgb(255,255,255);font-family:''微软雅黑'', ''Microsoft YaHei'';">14槽光纤收发器机架（2U）是一款经济型的用于机房的收发器机架。最多可允许插入14个我公司不同型号的外置电源光纤收发器，由主、备电源集中供电并可自动切换。</span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-size:12px;background-color:rgb(255,255,255);padding:0px;margin:0px;line-height:2;"> * 主、备电源配置保证系统不间断工作 </span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-size:12px;background-color:rgb(255,255,255);padding:0px;margin:0px;line-height:2;"> * 支持AC220V和DC-48V两种供电方式，使系统适用于多种工作环境 </span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-size:12px;background-color:rgb(255,255,255);padding:0px;margin:0px;line-height:2;"> * 支持多种型号速率的模块卡同时工作，极大地提高了系统的适用性 </span></p><p style="padding:0px;margin-top:0px;margin-bottom:0px;"><span style="font-size:12px;background-color:rgb(255,255,255);padding:0px;margin:0px;line-height:2;"> * 每个模块均支持热插拔功能 </span></p>', '<table cellspacing="0" cellpadding="0"><tbody style="padding:0px;"><tr style="padding:0px;" class="firstRow"><td width="138" style="padding:0px;"><p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">参</span><span style="font-family:''微软雅黑'', ''Microsoft YaHei'';padding:0px;font-size:12px;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">数</span></span></p></td><td valign="top" width="521" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> 规</span><span style="padding:0px;font-size:12px;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">格</span></p></td></tr><tr style="padding:0px;"><td valign="top" width="138" style="padding:0px;"><p><span style="padding:0px;font-s