mSun;line-height:2;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">最大功率</span></p></td><td valign="top" width="521" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> 80W</span></p></td></tr><tr style="padding:0px;"><td width="138" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">工作温度</span></p></td><td valign="top" width="521" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> -20~70</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">℃</span></p></td></tr><tr style="padding:0px;"><td width="138" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">工作湿度</span></p></td><td valign="top" width="521" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> 5%~95%</span></p></td></tr><tr style="padding:0px;"><td width="138" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">储存温度</span></p></td><td valign="top" width="521" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> -40~85</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">℃</span></p></td></tr><tr style="padding:0px;"><td width="138" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">储存湿度</span></p></td><td valign="top" width="521" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> 5%~95%</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">无凝结</span></p></td></tr><tr style="padding:0px;"><td valign="top" width="138" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">机箱尺寸</span></p></td><td valign="top" width="521" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> 90mm</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">（</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">H</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">）</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">x 485mm</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">（</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">W</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">）</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">x 245mm</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">（</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">D</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">）</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">/</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">高</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">*</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">宽</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">*</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">深</span><span style="padding:0px;font-size:12px;"></span></p></td></tr><tr style="padding:0px;"><td valign="top" width="138" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> </span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">模块卡尺寸</span></p></td><td valign="top" width="521" style="padding:0px;"><p><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;"> 89mm(H)*22mm(W)*81mm(D) /</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">高</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">*</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">宽</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">*</span><span style="padding:0px;font-size:14px;font-family:SimSun;line-height:2;">深</span></p></td></tr></tbody></table><p><br /></p>', '59c8c7454e1e0.jpg', '型号', 'F L Y-R A C K-1 4', 31, 0, 'yes'),
(40, '2U 16槽收发器机架', '2U 16槽收发器机架', 'FLY-RACK-16', 0, 5, '', 1, '2017-09-19 19:11:57', 1505750400, NULL, '<p><span style="color:rgb(65,65,62);background-color:rgb(255,255,255);font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">配有16个卡式（10/100M,10/100/1000M）收发器插槽，具有多种模块同时工作和热插拔等配置上的灵活性。主、备电源自动切换、完善的功能保证了整个系统的可靠性、连续性和智能性，是大中型城市的宽带光纤网络媒质转换的优选设备。本机架支持热插拔，可选用单电源或双电源供电方式。采用双电源时二个电源将同时供电，减轻了每个电源的负荷，延长了电源使用寿命。当有一个电源出现故障时，另一个电源又可独立供电，使收发器的工作不致中断。对电源进行维修和更换时不需拔出光纤收发器，也不需从机柜中拆下本机架，只需从机架背面拔出有故障的电源进行维修或更换，使维护极为方便快捷。从而能为光纤以太网络系统提供高可靠性、高容量、高集成度及高性能和经济实用的光纤网络中心解决方案，具有工作稳定、供电容量大、操作方便、易于维护等显著特点。</span></p>', '<p><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">技术参数插槽数：16槽</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">电源输入：AC 100～260V，50～60HZ/DC-48V (可选）</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">直流输出：DC +5V</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">纹波：≤50mv</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">噪音：≤50mv</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">电源保护：过压保护，过流保护，短路保护</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">工作温度：0～50℃</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">储存温度：-20℃～70℃</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">相对湿度：5%～95%</span><br style="padding:0px;margin:0px;color:rgb(65,65,62);font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);" /><span style="font-size:14px;color:rgb(65,65,62);background-color:rgb(255,255,255);">外型尺寸： 485×285×88mm（长×宽×高），19英寸2U高</span></span></p>', '59c8c76aa626c.jpg', '型号', 'F L Y-R A C K-1 6', 26, 0, 'yes'),
(41, '2U 16槽网管机架', '2U 16槽网管收发器机架', 'FLY-RACK-16W', 0, 6, '', 1, '2017-09-19 19:13:03', 1505750400, NULL, '<p><span style="color:rgb(51,51,51);background-color:rgb(255,255,255);font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">网管型光纤收发器是一款高可靠、低成本的以太网传输媒体转换器，其作用是高效率实现以太网电口和光口之间的转换，支持各种速率，单模/多模，单纤/双纤。此设备的网管界面设置简单，功能全面。支持多种网管方式，包括Snmp、Web、Console及Telnet等网管方式，并可以实现对机架的集中网管。</span></p>', '<p class="p0" style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(51,51,51);"><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';">2U 19英寸标准机箱，可直接安装在机架中，便于统一管理和维护</span></p><p class="p0" style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(51,51,51);"><img alt="" src="http://www.zx-net.com.cn/e/data/ecmseditor/kindeditor/attached/image/20140519/20140519150157_57223.jpg" style="padding:0px;margin:0px;vertical-align:middle;font-family:Tahoma;border:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span class="Apple-converted-space" style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;padding:0px;margin:0px;"> </span>网管模块和光纤收发器模块支持热插拔</span></p><p class="p0" style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(51,51,51);"><img alt="" src="http://www.zx-net.com.cn/e/data/ecmseditor/kindeditor/attached/image/20140519/20140519150157_57223.jpg" style="padding:0px;margin:0px;vertical-align:middle;font-family:Tahoma;border:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span class="Apple-converted-space" style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;padding:0px;margin:0px;"> </span>十六个模块插槽，可插16个网管型以太网光纤收发器模块和1个网管模块</span></p><p class="p0" style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(51,51,51);"><img alt="" src="http://www.zx-net.com.cn/e/data/ecmseditor/kindeditor/attached/image/20140519/20140519150157_57223.jpg" style="padding:0px;margin:0px;vertical-align:middle;font-family:Tahoma;border:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span class="Apple-converted-space" style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;padding:0px;margin:0px;"> </span>网管模块和网管光纤收发器模块网口支持MDI-MDIX Auto Crossover,可自动识别平行/交叉网线</span></p><p class="p0" style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(51,51,51);"><img alt="" src="http://www.zx-net.com.cn/e/data/ecmseditor/kindeditor/attached/image/20140519/20140519150157_57223.jpg" style="padding:0px;margin:0px;vertical-align:middle;font-family:Tahoma;border:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span class="Apple-converted-space" style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;padding:0px;margin:0px;"> </span>采用模块化电源设计，维护方便，屏蔽性更好，防止了电源产生的电磁信号干扰</span></p><p class="p0" style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(51,51,51);"><img alt="" src="http://www.zx-net.com.cn/e/data/ecmseditor/kindeditor/attached/image/20140519/20140519150157_57223.jpg" style="padding:0px;margin:0px;vertical-align:middle;font-family:Tahoma;border:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span class="Apple-converted-space" style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;padding:0px;margin:0px;"> </span>可监控各个网管型光纤收发