/p><p class="p0" style="padding:0px;margin-top:0px;margin-bottom:0px;font-family:Arial, Verdana, Helvetica, sans-serif;font-size:12px;white-space:normal;background-color:rgb(255,255,255);color:rgb(51,51,51);"><img alt="" src="http://www.zx-net.com.cn/e/data/ecmseditor/kindeditor/attached/image/20140519/20140519150157_57223.jpg" style="padding:0px;margin:0px;vertical-align:middle;font-family:Tahoma;border:0px;" /><span style="font-size:14px;font-family:''微软雅黑'', ''Microsoft YaHei'';"><span class="Apple-converted-space" style="font-family:''微软雅黑'', ''Microsoft YaHei'';font-size:14px;padding:0px;margin:0px;"> </span>良好的通风导热性设计，保障系统运转正常稳定</span></p><p><br /></p>', '59c8c79a22905.jpg', '型号', 'F L Y-R A C K-1 6 W', 33, 0, 'yes');
