INSERT INTO `flyin_services` (`id`, `servicecategory_id`, `sn`, `name`, `thumb`, `on_sale`, `recommend`, `date`, `add_time`, `custom_time`, `desc`, `recycle`) VALUES
(1, 1, '01', '数据堆积是由于交通捅塞造成的', '', 'yes', 'no', '2017-05-25', '2017-05-26 05:52:05', '', '<p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">一、 故障原因分析：</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">A点的有效数据发出后，在路途中的两个光纤收发器中不作差错校验，只有数据帧到达B点的交换核心时才做差错校验，将错误帧丢弃，而正确帧进入BUFFER，等待转发。但是，所有的差错校验过程都是一个程序控制过程，当某些特定的错误帧进入时，无论是帧长度检测还是CRC检验都不能查出错误，这种帧也被认为是正确帧进入BUFFER，但这类帧永远无法转发出去，进而在BUFFER中造成堆积，当BUFFER的占用量大到一定程度时，导致交换机无法继续运行。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">二、FHC0110-XX的解决方案：</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">....法判断BUFFER中的数据堆积是由于交通捅塞造成的、错误帧造成的，还是其它原因造成的，因此对于一个复杂系统无法用简单的手段处理。但是，对于光纤收发器因为它只有两个端口，如果可以实现交换机的上述检测功能，又出现了BUFFER堆积的问题时，我们可以简单了判断为光纤收发器的状态不正常，因而可以将它Reset</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">针对这一理解，解决方案就是在FHC0110-XX系列光纤收发器中内置以太网交换核心及一个大BUFFER，使其具有差错校验功能（当然，这样设计还具有其它的功能，在此不多述），同时在系统的设计中加入自动Reset功能，当系统判定自身进入严重故障状态时，自动进行Reset，从而最大限度地避免上位系统的故障可能。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">FHC0110-XX完成数据链路层的全部功能，对数据做帧级的差错校验及处理，同时FHC0110-XX具有2KMAC地址表，只有当一个数据帧具有确实存在的MAC地址，可以正确转发时，才将该帧发出，否则只能堆积在自身的BUFFER中，如果收发器也出现BUFFER大量堆积时，它认为自身状态严重故障，实施Reset动作，清除所有BUFFER中的数据，这样导致的结果是部分传输的数据丢失，但可以避免网络设备“死机"。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">在使用FHC0110-XX的系统环境中，只有当段的双绞线出现大量误码时，才可能导致交换机B的“死机”现象，而由光路上来的误码已由FHC0110-XX处理，有效地提高交换机的端口及整机交换效率，降低“死机”的风险。</p><p><br /></p>', 'no'),
(2, 1, '002', '光导纤维为传输介质的一种通信方式', '', 'yes', 'no', '2014-07-31', '2017-05-26 03:14:48', '', '<p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;"> 一、 概述</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">当今世界，光纤通信已成为通信的主要手段。同时，光纤通讯技术也在飞速的发展，使得光纤传输系统以其众多的优点，赢得了大家的青睐。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">光纤传输系统具有以下显著优点：容量大、传输距离远。光纤理论带宽可达20000GHz，无中继传输距离可达50-80公里。由玻璃制成，抗电磁干扰、传输质量好，可用于电力网和变电所内等强电磁环境中。光纤重量轻，可以弯曲，易于铺设。可节约贵重金属，且抗腐蚀能力很强。制作光纤的原料丰富，随着工艺的进步、规模的扩大，其成本进一步下降，整个传输系统的成本也低。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">二、 光纤传输系统简介</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">光纤传输即是以光波为载频，以光导纤维为传输介质的一种通信方式，因其拥有传输频带宽、信号损耗低、抗干扰能力强、重量轻等优点。光纤通信在近二十年来得到了飞速的发展。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">1、光纤的结构</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">当今世界，光纤通信已成为通信的主要手段。同时，光纤通讯技术也在飞速的发展，使得光纤传输系统以其众多的优点，赢得了大家的青睐。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">光纤传输系统具有以下显著优点：容量大、传输距离远。光纤理论带宽可达20000GHz，无中继传输距离可达50-80公里。由玻璃制成，抗电磁干扰、传输质量好，可用于电力网和变电所内等强电磁环境中。光纤重量轻，可以弯曲，易于铺设。可节约贵重金属，且抗腐蚀能力很强。制作光纤的原料丰富，随着工艺的进步、规模的扩大，其成本进一步下降，整个传输系统的成本也低。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">二、 光纤传输系统简介</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">光纤传输即是以光波为载频，以光导纤维为传输介质的一种通信方式，因其拥有传输频带宽、信号损耗低、抗干扰能力强、重量轻等优点。光纤通信在近二十年来得到了飞速的发展。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">1、光纤的结构</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">光纤裸纤一般分为三层：中心高折射率玻璃芯(芯径一般为50或62.5μm)，中间为低折射率硅玻璃包层(直径一般为125μm)，最外是加强用的树脂涂层。</p><p><br /></p>', 'no'),
(3, 1, '003', '数字视频光端机的原理及其应用', '', 'yes', 'yes', '2014-07-31', '2017-05-26 05:52:23', '', '<p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">一、 概述</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">当今世界，光纤通信已成为通信的主要手段。同时，光纤通讯技术也在飞速的发展，使得光纤传输系统以其众多的优点，赢得了大家的青睐。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">光纤传输系统具有以下显著优点：容量大、传输距离远。光纤理论带宽可达20000GHz，无中继传输距离可达50-80公里。由玻璃制成，抗电磁干扰、传输质量好，可用于电力网和变电所内等强电磁环境中。光纤重量轻，可以弯曲，易于铺设。可节约贵重金属，且抗腐蚀能力很强。制作光纤的原料丰富，随着工艺的进步、规模的扩大，其成本进一步下降，整个传输系统的成本也低。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">二、 光纤传输系统简介</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">光纤传输即是以光波为载频，以光导纤维为传输介质的一种通信方式，因其拥有传输频带宽、信号损耗低、抗干扰能力强、重量轻等优点。光纤通信在近二十年来得到了飞速的发展。</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">1、光纤的结构</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">光纤裸纤一般分为三层：中心高折射率玻璃芯(芯径一般为50或62.5μm)，中间为低折射率硅玻璃包层(直径一般为125μm)，最外是加强用的树脂涂层。</p><p><br /></p>', 'no'),
(4, 2, '001', '光纤收发器解决方案', '', 'yes', 'yes', '2014-07-13', '2017-09-19 11:17:43', '', '<p><span style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;">随着信息互联网的快速发展，人们对带宽的要求也越来越高，在传统的以太网中起连接作用的介质主要是双绞线。双绞线传输距离的极限大约为100米左右，如此短的传输距离制约了网络的发展，这也无疑使数据通讯质量受到影响。光纤收发器的运用，将以太网中的连接介质换为光纤。光纤的低损耗、高抗电磁干扰性，在使网络传输距离从200米扩展到2公里甚至几十公里，乃至于上百公里的同时，也使数据通讯质量有了较大提高。他使服务器、中继器、集线器、终端机与终端机之间的互联更加简捷。</span></p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">在实际的应用中，光纤收发器主要有下面三种基本连接方式：</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">一、用户接入网</p><p style="color:rgb(0,0,0);font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:normal;white-space:normal;">用户接入网利用光纤收发器带有的网管功能，可以对每一个分散用户点进行集中管理，光纤收发器的10Mbps/100Mbps自适应及10Mbps/100Mbps自动转换功能，为用户提供足够的带宽。也可以利用链路失败告警（LFA）功能，在点对点的传输中相互监控来代替集中网管功能，降低接入成本，同时利用半双工/全双工自适应及半双工/全双工自动转换功能，可以在用户端配置廉价的半双工HUB，几十倍的降低用户端的组网成本，提高网络运营商的竞争力。</p><p><br /></p>', 'no');
